import React from 'react';
import "./styles.scss";

export class DateInput extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            start: "1979-09-19",
            end: "2019-09-19"
        }
    }
    startChange = (e) => {
        this.setState({
            start: e.target.value
        })
    }
    endChange = (e) => {
        this.setState({
            end: e.target.value
        })
    }
    render = () => {

        return (
            <form className="dateInput">
                <input type="date" className="startDate" value={this.state.start} onChange={this.startChange} max = {this.state.end}/>
                <input type="date" className="endDate" value={this.state.end} onChange={this.endChange} min = {this.state.start}/>
            </form>
        );
    }
}
